        [head=2]Pebbles Path to Chem:[/head]


        [head=1][color=blue]DIPHENHYDRAMINE[/color][/head] [head=3](Anti-Poison)[/head]


                The monster. Diphen. You'll need it if there's snakes and spiders crawling out of the vents, if people are popping maints pills, and poison damage is incredibly important to treat fast. [italic][color=red]If somebody's damage is over 194 with poison, they cannot be revived[/color][/italic], so you need to be on top of it, and dylo doesn't cut it. 

                That being said, diphen is a temperature game. [bold]If you use your preheated beaker, you'll burn the oil into ash.[/bold] 

        [color=red][bold]GET A NEW BEAKER, ONLY TRANSFER 5u AT A TIME, AND WASH IT OUT WITH WATER AFTER EVERY BATCH.[/color][/bold]



        [bold]Diphen/Poison NO OD (potent - small doses!!!)[/bold]

                Remember that extra ammonia you made during Sigy? 50 Ammonia + 50 Ethanol = 100 Diethylamine. You can mix Diethylamine in your heated beaker, but NOT oil.

                To make the oil, get a new beaker or wash out your beaker with 5u of water in the sink to cool it down. Find a welding fuel tank, and mix 30 Welding Fuel + 30 Hydrogen + 30 Carbon, x2. This makes 180 oil and ensures I don't need to do this again. 

                Now, take your COOLED beaker, and mix 20 Oil + 20 Diethylamine + 20 Table Salt + 20 Ethanol + 20 Carbon and slap that bad boy on the hotplate. You can use multiple beakers to try and streamline the process a little bit, filling one beaker while another cooks.

                Remember that after the Diphen is done cooking, your beaker is hot again, and you need to wash it out with water before starting the process again.



                I am absolutely certain that there's a better way to cook Diphen efficiently, but I havent found it yet, and this is what works for me. I try and repeat the process, making more table salt, until I've used all 100u of the Diethylamine. That will make a total of 300u of Diphen, I think. You can use the extra Diphen for refills as the shift goes on.

        Congrats, and good luck!
