      content: >-
        [head=2]Advanced Topicals[/head]

                There's two kinds of advanced topicals: Regenerative mesh, and Medicated Sutures.

                Mesh is the equivalent of better ointment, since it heals 10 burn damage per use instead of 5 burn damage.

                Sutures are the equivalent of better bruise packs, which also heal 10 brute damage instead of 5 brute damage, but they also stop bleeding similar to gauze.


                Something to keep in mind when making advanced topicals: when the recipe calls for "one bruise pack," or "one ointment," it means one [italic]use[/italic] of that topical. That means a stack of bruise packs is actually 10 bruise packs, same with ointment.


        Regenerative Mesh (better ointment): 

                Recipe for 1 stack of mesh = 20u sigy, 20u derma, 1 aloe, 1 cloth, 1 ointment

                For 10 stacks = 200u sigy, 200u derma, 10 aloe, 10 cloth, 10 ointment (meaning, one stack of ointment from the vend. one "use" of oint is one oint)
                If you used my guide for normal chems, you should already have enough materials in your chemmaster to make another 200u of sigy. The derma you'll need to make more kelotane for and repeat the recipe (30u kelo, 30u phosphorus, 30u oxygen) until you have 200u available.

        Medicated Sutures (better bruise packs):

                Recipe for 1 stack = 20u tranex acid, 20u crypto, 1 poppy, 1 cloth, 1 bruise pack

                For 10 stacks = 200u tranex acid, 200u crypto, 10 poppies, 10 cloth, 10 bruise packs

                To make the related chems here (tranex acid and cryptobiolin) I'll give you some instructions you can use:

        You'll probably need to restock carbon, oxygen, sugar, and possibly potassium in your chemmaster. Be careful not to use up all of one ingredient.


        Tranex Acid
                In this recipe, you need to mix in a certain order or it'll make hydroxide when you don't want hydroxide. 20 oxygen + 10 sulfur + 10 hydrogen = 30u sulfuric acid. You'll want to repeat that process three times for a total of 90u of sulfuric acid. Then use 30u sulfuric acid, and add 10u carbon, 10u oxygen, and 40u sugar.
                You'll want to repeat that until you use all the sulfuric acid, since you'll need 200u of tranex acid.

        Cryptobiolin
                This one's a lot simpler. 25 oxygen + 25 sugar + 25 potassium = 75 crypto, x3.


                Personally, I like to make my topicals three at a time in the microwave, since they only take 10 seconds each and you can set the timer to 30 seconds. That means I'll put in the entire jug of each chem, the whole stack of cloth, three of whatever plant, and the whole stack of the related topical.


                It's a wildly different process than anything else in chem, and has more in common with cooking as a chef than mixing as a chemist. But! It's still pretty easy. You got this.
