                Now, take your COOLED beaker, and mix 20 Oil + 20 Diethylamine + 20 Table Salt + 20 Ethanol + 20 Carbon and slap that bad boy on the hotplate. You can use multiple beakers to try and streamline the process a little bit, filling one beaker while another cooks.

                Remember that after the Diphen is done cooking, your beaker is hot again, and you need to wash it out with water before starting the process again.



                I am absolutely certain that there's a better way to cook Diphen efficiently, but I havent found it yet, and this is what works for me. I try and repeat the process, making more table salt, until I've used all 100u of the Diethylamine. That will make a total of 300u of Diphen, I think. You can use the extra Diphen for refills as the shift goes on.

        Congrats, and good luck!
