  - uid: 329
    mapInit: true
    paused: true
    components:
    - type: MetaData
      name: printed paper
    - type: Transform
      pos: 33.161293,8.6719
      parent: 1
    - type: Paper
      content: "\n[head=1][color=green]Pebbles' Path to Chemistry![/color][/head] [color=yellow]Updated Version 2[/color]\r\n\r\n        [italic]Everybody does chemistry different, and has it optimized in different ways. I am still learning new things myself! This is just how I do chemistry, and it's helped me make all chems but diphen in under 10 minutes consistently. So, while I'm still learning, I know what I'm doing![/italic]\r\n\r\n[head=2]FIRST THING'S FIRST: SETUP.[/head]\r\n\r\nThe first thing you need when you start, are tools. \r\n\r\n        A [bold]crowbar[/bold] so you don't get trapped somewhere and die, a [bold]flashlight[/bold] so you can SEE when you're looking through maints for the elusive welding fuel tank, a [bold]wrench[/bold] to move things around and use the condenser, and a [bold]screwdriver[/bold] for when cargo gets you your chemvend restock like an hour late. :)\r\n\r\n        I always stop by the tool room first, grab what I need, and then get to work.\r\n\r\n[head=3]The Age Old Question:[/head]\r\n        [italic]Jugs, Beakers, Dispenser, or Chemmaster?[/italic]\r\n        Personally, I use the [bold]Chemmaster[/bold], and I'd recommend you do too. It's easier to keep track of everything, streamlines the process, and the speed it provides is unmatched.\r\n\r\n        When moving your chems from the dispenser into the Chemmaster, the order is [bold]IMPORTANT.[/bold]\r\n\r\nHere's what I do, and why.\r\n\r\n        - [bold]Carbon, Oxygen, Sugar, Lithium[/bold] (quick and easy inap and brutes like bruiz)\r\n        - [bold]Potassium, Nitrogen, Silicon[/bold] (quick dylo)\r\n        - [bold]Iron, Copper[/bold] (right after silicon so you can make fersilicite -> lepo instantly)\r\n        - [bold]Hydrogen![/bold] honestly you could put it between Lithium and Potassium but I usually put it here. Needed for brutes AND sigy\r\n        - [bold]Phosphorus, Chlorine, Sodium, Radium[/bold] (close together to make mutagen fast BUT keeps chlorine and sodium together for salt)\r\n        - [bold]Ethanol, Sulfur[/bold] (don't need them often, and they're often used with \"tier two\" chems, or chems that you have to make and will be at the bottom of your list)\r\n        - [bold]Mercury[/bold] IF there's a psychologist who might want you to make psicodine or something. Or if you wanna make a ton of happy pills like I do!\r\n\r\n        So: [bold]Carbon, Oxygen, Sugar, Lithium, Potassium, Nitrogen, Silicon, Iron, Copper, Hydrogen, Phosphorus, Chlorine, Sodium, Radium, Ethanol, Sulfur, (Mercury)[/bold]\r\n\r\nOh, then [bold]plasma and water[/bold] of course.\r\n\r\n        The method to get the chems from the jugs to the Chemmaster is the same for dumping things down a drain. You'll want to place the jug on the floor, drag it over to the Chemmaster, and dump it in!\r\n\r\n        Now, what you're given in the chem dispenser isn't enough to make all the chems. You'll also want to dispense a few jugs from the ChemVend. You'll want 2 more carbon jugs, 1 hydrogen, 1 oxygen, 1 silicon, and 1 sugar.\r\n\r\n        Try not to use up all of a chem in the chemmaster, or it'll be removed from the list - keep track of how much of each chem you have left!\r\n\r\n        Many of these recipes also call for the mixture to be heated to a certain degree. I bypass this with a method called the \"Lava-Beaker.\" Now... you want to be VERY careful when doing this, because it will superheat your beaker and you could burn your hands, so make sure you put on gloves. For some reason, there aren't real consequences to using a lavabeaker, given how temperatures work in space or something, but that could change as technology goes on.\r\n    Anyways, I like to use Benzene, (1u carbon, 1u hydrogen) then heat it on the hotplate for about 10 seconds, and put it in my chemmaster. The chemmaster will retain the heat and you won't need to heat anything ever again. Try and label your beaker \"HOT\" or something so you don't mix it up when you're making diphen or oil.\r\n\r\n[head=2]What and How Much?[/head]\r\n\r\n        The order you make chems is important too. \r\n\r\n        You'll typically want to start with the basic form of each of the damage types, so [color=orange]Bic for Brute[/color], [color=purple]Dylo for Poison[/color], [color=darkblue]Derma for Burns[/color], [color=lightblue]Dex+ for Airloss[/color], [color=blue]Saline for Blood Level[/color]. \r\n\r\n        You may want to make some Arith for Radiation too if the engineers get smacked by rad waves or there's a particularly nasty artifact in science. \r\n\r\n        Personally I [bold]don't put the Bic in the chem locker[/bold], since it's so carbon intensive to make. IF I put Bic in the chem locker, it's after making a second round of the advanced brutes.\r\n\r\n[bold]Bic/Brute 15u OD (DONT MIX BRUTES)[/bold]\r\n        25 carbon, + 25 oxygen + 25 sugar -> 75 inaprovaline, -25 inap -> 50 inap + 50 carbon = 100u Bic! I do this process two times, then use the remaining 50 inap + 50 carbon for the final hundred.\r\n         \r\n        You want 300u Bic total: (100 bic to make 200u of each advanced brute chem). \r\n\r\n[bold]Derma/Burns 10u OD[/bold]\r\n        First, make 200u kelotane, you'll need it for everything else you're doing as well as Derma, so may as well make it now! That's 50u Carbon + 50u Silicon, x2.\r\n        Then, you'll want to make your derma, enough to fill a jug(200u) with at least 60u left over to make pyra later. I usually go 30u kelo + 30u phosphorus + 30u oxygen, x3.\r\n\r\n[bold]Dex+/NonCritAirloss 25u OD[/bold]\r\n        While the recipe for dexalin SAYS: 2 parts oxygen, 1 part plasma, it lies. You only need one unit of plasma because it's just a catalyst. \r\n        1 plasma + 40u oxygen = 60u dexalin, -1 plasma -30 dexalin +30 carbon +30 iron = 90 dexalin plus, x2. Makes 180u Dex+.\r\n\r\n[bold]Dylo/Poison 20u OD (REACTS W INAP)[/bold]\r\n        You'll want to make 300u total of dylo, 200u for the dylo jug, and 100u for Arith later. Yes you technically only need 50u dylo for 200u of Arith, but the buttons make it more convenient to just make extra. No harm no foul.\r\n        25 potassium + 25 nitrogen + 25 silicon, x4.\r\n\r\n[bold]Saline/BloodLevel,Thirst NO OD[/bold]\r\n        Make 200u of salt first, because you'll need it for sigy and diphen too. That's 50 chlorine + 50 sodium, x2. \r\n        Then add 20u salt to your beaker and either click 100u of water or spam the 50u button until the beaker is full of saline. Repeat twice for 200u Saline.\r\n\r\n[bold]Arith/-Rads +Brute NO OD (bleed)[/bold]\r\n        Now you'll use the extra dylo you made earlier. 25 dylo + 25 radium = 50 Hyronalin, +50 Hydrogen = 100 Arith, x2.\r\n        Technically Arith has no overdose, but if you give somebody too much Arith for their radiation damage, they'll start to bleed until it's all metabolized. Not healthy. Label it.\r\n\r\n\r\n        After these basics, you'll want to work on advanced brutes. Though if I'm being honest? I make them first. [bold]But[/bold] if you're just starting out it's best to do basics then the advanced ones. \r\n        There's two main sections of advanced chems, Brutes and Burns. Do brutes first. That'll be Lace, Punct, Bruiz, then burns is Lepo, Pyra, Insu. Sigy is the most complex so you'll save that for last.\r\n\r\n        Advanced Brutes are tricky because [bold]you HAVE to mix in EXACT amounts[/bold] or you'll end up making [color=red]Razorium[/color], which not only wastes carbon and chems but HURTS!! Pay attention to the amounts you're using and the buttons you're pressing.\r\n        You'll use the Bic you made earlier to make the brutes, 100u for each of the three for a total of 300u.\r\n\r\n[bold]Lace/Slash 12u OD (DONT MIX BRUTES)[/bold]\r\n        50 carbon + 50 hydrogen = 50 benzene, + 50 bic = 100u Lace, x2.\r\n\r\n[bold]Punct/Pierce 11u OD (DONT MIX BRUTES)[/bold]\r\n        50 Oxygen + 50 Hydrogen = 100 Hydroxide, -50 Hydroxide +50 Bic = 100u Punct, then use the other 50 Hydroxide +50 Bic to make your other hundred.\r\n\r\n[bold]Bruiz/Blunt 10.5u OD (DONT MIX BRUTES)[/bold]\r\n        Honestly? My least favorite to make but one of the most useful chems out there. The order here is PARAMOUNT.\r\n        30 Bic + 30 Sugar + 50 Lithium = 60 Bruiz and 13 Lithium. Empty out the excess Lithium and rinse wash repeat until you've used the last of your Bic. \r\n        The Lithium in this recipe is a catalyst similar to plasma, but it's actually used up in the process, so you want to make sure you always add either [bold]exactly the amount[/bold] of lithium you need at once (not pressing the 10 button three times) [bold]or add MORE[/bold] lithium than you need and just remove it after.\r\n\r\n[bold]Lepo/Cold,BodyTemp NO OD[/bold]\r\n        This one is a really fun process, and you can make all you need in under a minute. Put 1 plasma in your beaker and leave it there, then 20 silicon + 20 iron = 40 fersilicite, + 40 copper = 80 Lepo, put the Lepo back in your chemmaster and repeat this step until you only have 40 copper left, for a total of 320 Lepo. This makes enough for you to fill a jug (200u) make pyra (60u) and make insu (60u).\r\n\r\n[bold]Pyra/Heat 15u OD[/bold]\r\n        Use the Lepo you already made and the extra Derma you already made, mixed in your preheated beaker, to make Pyra in a flash. 30 Lepo + 30 Derma + 30 Carbon = 90 Pyra, x2. Makes 180 Pyra. \r\n        I always remember Derma and carbon are for Pyra cause heat, char, and burns are all similar.\r\n\r\n[bold]Insu/Shock 12u OD[/bold]\r\n        Use the Lepo you already made and the extra Kelotane you already made. 30 Lepo + 30 Kelo + 30 Silicon = 90 Insu, x2. Makes 180 Insu. \r\n        This one I remember cause insulated gloves are made of silicon and kelo and silicon are the ingredients...\r\n\r\nNow for the big boy... the final boss if you will.\r\n\r\n[bold]Sigy/Caustic 16u OD[/bold]\r\n        This one is infamous for the number of steps, but it's easy once you get the hang of it. You need [bold]five [/bold]things to make Sigy, and [color=green]you already have three[/color] in your chemmaster at this point: water, sugar, and kelotane. All you need to do is make Sodiu"
