        - 1 Chlorine

        - 1 Hydrogen

        - 1 Iron

        - 2 Oxygen

        - 1 Phosphorus

        - 2 Silicon

        - 1 Sodium

        - 1 Sugar


        5) Dump the following jugs into the chemmaster:

        - 1 Carbon

        - 1 Chlorine

        - 1 Copper

        - 1 Hydrogen

        - 1 Iron

        - 1 Oxygen

        - 1 Silicon

        - 1 Sodium


        6) Make the following beaker pours. Set the ammount to 50:


        50 Nitrogen, 50 Potassium -> [ ]

        45 Lithium -> [ ]

        45 Lithium -> [ ]

        100 Hydrogen -> [ ]

        50 Radium -> [ ]

        50 Radium -> [100H]

        25 Radium, 50 Ethanol - [ ]

        50 Chlorine -> [50Ra]


        7) Transfer jugs. Always set the ammount to 25.


        Carbon #1: 

        [100C] [100C]

        Carbon #2:

        [25C] [25C] [25C] [25C] [50C] [50C]


        Oxygen #1:

        [25C 50O] [25C 50O] [25C 50O] [100C 25O] [100C 25O]

        Oxygen #2:

        [200 O]


        Phosphorus:

        [25C 50O 50P] [25C 50O 50P] [25C 50O 50P] [50Ra 50Cl 50P]


        Silicon:

        [25C 50O 50P 25Si] [25C 50O 50P 25Si] [25C 50O 50P 25Si] [25C 75Si] [50N 50Po 50Si]


        Sugar:

        [100C 25O 25Su] [100C 25O 25Su] [45Li 50Su] [45Li 50Su] [50Su]


        Bicaridine:

        [45Li 50Su 50Bic] [45Li 50Su 50Bic] [100Bic] [100Bic]


        Dermaline:

        [50C 50Derm] [200 Derm] [200 Derm]


        Dylovene: 

        [100H 50Ra 50Dylo] [25Ra 50E 25Dylo] [75Dylo]


        Unstable Mutagen:

        [100UM] [25Ra 50E 25Dylo 50UM]



        8) Using your lavabeaker, make the following chemmaster mixes:


        50 Carbon, 50 Hydrogen -> 50 Benzene

        50 Carbon, 50 Hydrogen -> 50 Benzene

        50 Hydrogen, 50 Oxygen -> 100 Hydroxide

        50 Chlorine, 50 Sodium -> 100 Salt

        50 Chlorine, 50 Sodium -> 100 Salt


        50 Oxygen [P] -> 75 Dexalin

        50 Oxygen [P] -> 75 Dexalin


        40 Copper, 20 Silicon, 20 Iron [P] -> 80 Leporazine

        40 Copper, 20 Silicon, 20 Iron [P] -> 80 Leporazine

        40 Copper, 20 Silicon, 20 Iron [P] -> 80 Leporazine

        30 Copper, 15 Silicon, 15 Iron [P] -> 60 Leporazine


        8) Using your lavabeaker, make the following pours. Set the ammount to 100 IMPORTANT:

        100 Benzene -> [100Bic]

        100 Hydroxyde -> [100Bic]

        50 Dexalin, 50 Iron -> [50C]

        50 Leporazine -> [50C 50Derma]

        50 Leporazine -> [25C 75Si]

        100 Leporazine -> [ ]

        100 Leporazine -> [100Lepo]

        40 Salt -> [ ]


        9) Fill the salt jug to the brim using the sink.

        10) Merge both Bruizine jugs.

        11) Flush the remaining sugar in the drain

        `

