    - type: Paper
      content: >+
        [color=#1b67a5]


        [head=2][color=#1b67a5]10/9/2565[/color][/head]


        [color=#1b67a5]


        Decided to start writing down dreams I have. They're weird.


        I was back at home, specifically standing out in the fields near the farm. Everything was a bit blurry. I explored a bit of it, but no one was there. 


        I remember it was dark out, but the sky was absent of any clouds or stars, as if it was just a void.


        It was oddly calming, but at the same time chilling.






        [color=#1b67a5]


        [head=2][color=#1b67a5]10/10/2565[/color][/head]


        [color=#1b67a5]


        Nightmare.


        Dreamed I was back on that snowy planet. The cold bit at my blood-soaked fingers. I'm not sure if the blood was coming from myself or from figures I couldn't make out.


        I remember there being large pieces of metal sticking out of the snow. 




