        [color=#1b67a5]


        [head=2][color=#1b67a5]10/12/2565[/color][/head]


        [color=#1b67a5]


        Nightmare.


        Dreamt I was back at the damn lab again. Body didn't look quite right.







        [color=#1b67a5]


        [head=2][color=#1b67a5]10/13/2565[/color][/head]


        [color=#1b67a5]


        I had a dream where I was running down a road. Not from anything or anyone, just seemingly for fun. It was oddly a little freeing. It was sunny, and beautiful.


        Hills were shades of green and yellow. Maybe near the end of spring. 






