    - type: Paper
      content: "[color=#1b67a5]\n\n[head=2][color=#1b67a5]10/21/2565[/color][/head]\n\n[color=#1b67a5]\n\nHad a nice dream for once. I was back at home, having a nice meal with my parents again. My friends came over, and we all just talked. \n\nIt felt sort of real, as if they were genuine conversations. \n\nI looked like my old self again. Syrus looked like his old self, too. \n\n\n\n\n[color=#1b67a5]\n\n[head=2][color=#1b67a5]10/22/2565[/color][/head]\n\n[color=#1b67a5]\n\nInstantly forgot what happened in the dream.\n\n\n\n\n\n\n\n[color=#1b67a5]\n\n[head=2][color=#1b67a5]10/23/2565[/color][/head]\n\n[color=#1b67a5]\n\nI was gardening with my mom. I looked like my current self, but she didn't really seem to mind. She just acted like I was the same as before. We were growing butterfly orchids near the front of the home.\n\nIt was nice, but it sort of made me wanna cry more than anything. "
